import React, { Component } from 'react';

const Button = (props) => {
	const createButton = (): string => {
		switch (props.period) {
			case 1:
				return '春';
			case 2:
				return '夏';
			case 3:
				return '秋';
			case 4:
				return '冬';
		}
	};

	return <button type="button">{props.year}</button>;
};

export default Button;
